import React from "react";
import btn from "./assets/button.png";

function Button() {
  return (
    <div>
      <p>Time Records</p>
      <div>
        <button>
          <img src={btn} alt="btn" /> Add New
        </button>
      </div>
    </div>
  );
}

export default Button;
